// CombinedForm.js
import React, { useState } from 'react';
import { useAuth } from '../../AuthContext';
import { fillPreMedicalForm, createBlogPost } from '../../apiService';
import './CombinedForm.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';

const CombinedForm = () => {
  const { user } = useAuth();

  const [symptoms, setSymptoms] = useState('');
  const [title, setTitle] = useState('');
  const [content, setContent] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const preMedicalFormResponse = await fillPreMedicalForm({ symptoms, patient: user.id });
      if (preMedicalFormResponse) {
        const blogPostResponse = await createBlogPost({ title, content, author: user.id });
        console.log('Pre-Medical Form Response:', preMedicalFormResponse);
        console.log('Blog Post Response:', blogPostResponse);
      }
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="container mt-5">
      <div className="form-container mt-5">
        <h2 className="mb-4">Create a Post and Fill Pre-Medical Form</h2>
        <Form className="combined-form" onSubmit={handleSubmit}>
          <Form.Group className="mb-3">
            <Form.Label>Title:</Form.Label>
            <Form.Control type="text" value={title} onChange={(e) => setTitle(e.target.value)} />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Content:</Form.Label>
            <Form.Control as="textarea" rows={3} value={content} onChange={(e) => setContent(e.target.value)} />
          </Form.Group>
          <Form.Group className="mb-3">
            <Form.Label>Symptoms:</Form.Label>
            <Form.Control as="textarea" rows={3} value={symptoms} onChange={(e) => setSymptoms(e.target.value)} />

            <Form.Group className="mb-3">
        <Form.Label>Symptoms</Form.Label>
        <Form.Check
          type="checkbox"
          label="Restlessness"
          name="symptoms"
          value="Restlessness"
          checked={patientData.symptoms.includes('Restlessness')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Uncontrollable feelings of worry"
          name="symptoms"
          value="Uncontrollable feelings of worry"
          checked={patientData.symptoms.includes('Uncontrollable feelings of worry')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Increased irritability"
          name="symptoms"
          value="Increased irritability"
          checked={patientData.symptoms.includes('Increased irritability')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Difficulty concentrating"
          name="symptoms"
          value="Difficulty concentrating"
          checked={patientData.symptoms.includes('Difficulty concentrating')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Sleep difficulties"
          name="symptoms"
          value="Sleep difficulties"
          checked={patientData.symptoms.includes('Sleep difficulties')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Feeling very sad, hopeless or worried. Children and adolescents with depression may be irritable rather than sad"
          name="symptoms"
          value="Feeling very sad, hopeless or worried"
          checked={patientData.symptoms.includes('Feeling very sad, hopeless or worried')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Low Energy"
          name="symptoms"
          value="Low Energy"
          checked={patientData.symptoms.includes('Low Energy')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Having thoughts of self-harm or suicide"
          name="symptoms"
          value="Having thoughts of self-harm or suicide"
          checked={patientData.symptoms.includes('Having thoughts of self-harm or suicide')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Being easily irritated or frustrated."
          name="symptoms"
          value="Being easily irritated or frustrated"
          checked={patientData.symptoms.includes('Being easily irritated or frustrated')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Eating too much or too little, which may result in weight gain or weight loss"
          name="symptoms"
          value="Eating too much or too little"
          checked={patientData.symptoms.includes('Eating too much or too little')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Experiencing physical issues like headache, stomachache or sexual dysfunction"
          name="symptoms"
          value="Experiencing physical issues"
          checked={patientData.symptoms.includes('Experiencing physical issues')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Having the urge to avoid things that trigger anxiety"
          name="symptoms"
          value="Having the urge to avoid things"
          checked={patientData.symptoms.includes('Having the urge to avoid things')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Having difficulty controlling worry"
          name="symptoms"
          value="Having difficulty controlling worry"
          checked={patientData.symptoms.includes('Having difficulty controlling worry')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Having trouble sleeping"
          name="symptoms"
          value="Having trouble sleeping"
          checked={patientData.symptoms.includes('Having trouble sleeping')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Having an increased heart rate"
          name="symptoms"
          value="Having an increased heart rate"
          checked={patientData.symptoms.includes('Having an increased heart rate')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Having a sense of impending danger, panic or doom"
          name="symptoms"
          value="Having a sense of impending danger, panic or doom"
          checked={patientData.symptoms.includes('Having a sense of impending danger, panic or doom')}
          onChange={handleChange}
        />
        <Form.Check
          type="checkbox"
          label="Trouble concentrating or thinking about anything other than the present worry"
          name="symptoms"
          value="Trouble concentrating or thinking about anything other than the present worry"
          checked={patientData.symptoms.includes('Trouble concentrating or thinking about anything other than the present worry')}
          onChange={handleChange}
        />
      </Form.Group>


          </Form.Group>
          <Button variant="primary" type="submit">
            Submit
          </Button>
        </Form>
      </div>
    </div>
  );
};

export default CombinedForm;
